import React from 'react';
import axios from 'axios';

class Winners extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
        name: 'Members!'
    };
  }

  render() {
    return (
        <React.Fragment>
            <h1>{this.state.name}</h1>
        </React.Fragment>
    );
  }
}

export default Winners;
